import React from 'react'

export default function Currencybox(props) {
const{
  listcurrency,
  selectCurrency
} = props

  return (
    <div>
      <input type = "number" className="input" />
      <select value = {selectCurrency}>
        {listcurrency.map(option => (
          <option key = {option}
          value ={option}> {option}
          </option>
        ))}

        </select>
    </div>
  )
}
